import  { FC } from 'React';
import styled from 'styled-components';

import { Wrapper } from '../../styledHelpers/Components';
import { Colors } from '../../styledHelpers/colors'

// import { ExpandedMenu } from '.ExpandedMenu';

const InnerWrapper = styled.div`
width:1920px;
background: ${Colors.white};
`;

const RightIcons = styled.div`
text-align: right;
`;
const LeftIcons = styled.div`
text-align: right;
`;
const SearchBar = styled.div`
`;
const InputWrapper = styled.div`
`;
const HouBar = styled.div`
`;

export const TopBar: FC = () => {
    return (
        <Wrapper>
            <InnerWrapper>
                <img src="./media/logo.png" alt=""/>
                <div>

                </div>

                <InputWrapper>
                <LeftIcons>
                    <img src="./media/icons/house2.png" />
                </LeftIcons>
                <SearchBar>
                     <div>
                        <input type="szukaj" ></input>
                         <img src ="./media/icons/search.png"  alt="" ></img>
                    </div>
                </SearchBar>
                <RightIcons>
                    <img src="./media/icons/house.png" alt=""/>
                    <img src="./media/icons/comments.png" alt="" />
                    <img src="./media/icons/bell.png" alt=""/>
                </RightIcons>
                <HouBar>
                    <img src="./media/icons/house2.png" alt="" ></img>

                </HouBar>
                </InputWrapper>
            </InnerWrapper>
        </Wrapper>
    );
};
